import { Redirect } from "react-router";

export default function Authenticated( props ) {

    const RenderSwitch = () => {
        switch ( param ) {
            case ( "/" ):
                props.loggedIn ?
                    <Redirect to="/frontpage" /> :
                    <Redirect to="/access" />
                break
            case ( "/access" ):
                props.loggedIn ?
                    <Redirect to="/frontpage" /> :
                    <Redirect to="/access" />
                break
            case ( "/frontpage" ):
                props.loggedIn ?
                    <Redirect to="/frontpage" /> :
                    <Redirect to="/access" />
                break
        }
    }

    return (
        { RenderSwitch }
    )
}
